INSERT INTO `faq` (`id`, `question`, `answer`) VALUES
(5, 'Cos''&egrave; Loco?', 'Loco &egrave; un sito che aiuta l''incontro tra la domanda e la richiesta di locali in affitto per gli studenti'),
(6, 'Sono uno studente. Come mi puÃ² essere utile Loco?', 'Una volta registrato, potrai visualizzare le ultime offerte inserite, eseguire la ricerca nel nostro database dei locali in affito, visualizzare le informazioni dettagliate su ciascun annuncio, contattare il locatore per maggiori informazioni sugli annunci e opzionare l''offerta che ti interessa.'),
(7, 'Sono un locatore. Cos''ha da offrirmi Loco?', 'Una volta registrato come locatore, potrai inserire i tuoi annunci in modo semplice e veloce. Potrai specificare le informazioni generiche del tuo locale in affitto, caricare le photo e inserire le informazioni aggiuntive a seconda della tipologia del locate. Potrai visualizzare l''elenco dei locatari che hanno mostrato l''interesse nei tuoi annunci, contattarli attraverso il sistema di messagistica interna e, infine, marcare l''offerta come disattivata oppure riattivarla'),
(8, 'Come faccio a registrarmi?', 'Basta premere il pulsante REGISTRA sulla pagina principale! La registrazione Ã¨ completamente gratuita e consiste nel fornire un minimo di informazioni per completare il tuo profilo. All''atto di registrazione puoi scegliere il ruolo che vuoi assumere - locatore oppure locatario.\r\nUna volta riempita la form clicca su REGISTRATI. Benvenuto nel mondo Loco!'),
(9, 'Se opziono un alloggio, lo potrÃ² anche deopzionare?', 'Ovviamente sÃ¬. Se per qualche motivo hai cambiato idea e non sei piÃ¹ interessato di essere considerato come un locatario potenziale per un certo alloggio, basta che vai sulla pagina dell''alloggio e clicchi su DEOPZIONA! E'' semplice, Ã¨ Loco!'),
(10, 'Che fine fa il mio annuncio una volta che lo marco come non attivo?', 'Di norma l''annuncio viene marcato come non attivo dopo la stipula del contratto con i locatari. Pertanto l''annuncio sarÃ  ancora visibile sul sito in modo da permettere ai potenziali locatari futuri di prenderlo in considerazione. Una volta che termina il contratto con i tuoi locatari, puoi rendere l''annuncio di nuovo attivo!');

